// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./IVerifier.sol";

contract BridgeWithZKP is ReentrancyGuard, Ownable {
    struct Deposit {
        uint256 amount;
        bytes32 commitment;
        bool withdrawn;
    }

    // Mappings
    mapping(bytes32 => Deposit) public deposits;
    mapping(bytes32 => bool) public nullifierHashes;
    mapping(bytes32 => uint256) public withdrawalIntents;

    // Constants
    uint256 public constant WITHDRAWAL_DELAY = 10; // blocks
    IVerifier public verifier;

    // Events
    event DepositCreated(uint256 amount, bytes32 indexed commitment, uint256 timestamp);
    event WithdrawalIntentSubmitted(bytes32 indexed intentHash, uint256 blockNumber);
    event WithdrawalCompleted(address indexed recipient, uint256 amount);

    constructor(address _verifier) {
        verifier = IVerifier(_verifier);
    }

    // Step 1: Create deposit
    function deposit(bytes32 commitment) external payable nonReentrant {
        require(msg.value > 0, "Amount must be greater than 0");
        require(deposits[commitment].amount == 0, "Commitment exists");

        deposits[commitment] = Deposit({
            amount: msg.value,
            commitment: commitment,
            withdrawn: false
        });

        emit DepositCreated(msg.value, commitment, block.timestamp);
    }

    // Step 2: Submit withdrawal intent
    function submitWithdrawalIntent(bytes32 intentHash) external {
        require(withdrawalIntents[intentHash] == 0, "Intent already exists");
        withdrawalIntents[intentHash] = block.number;
        emit WithdrawalIntentSubmitted(intentHash, block.number);
    }

    // Step 3: Complete withdrawal
    function completeWithdrawal(
        uint256 amount,
        address payable recipient,
        bytes32 nullifierHash,
        bytes calldata proof,
        bytes32 secret
    ) external nonReentrant {
        // Verify intent exists and delay passed
        bytes32 intentHash = keccak256(abi.encode(
            amount, recipient, nullifierHash, secret
        ));
        require(withdrawalIntents[intentHash] > 0, "No intent found");
        require(block.number >= withdrawalIntents[intentHash] + WITHDRAWAL_DELAY, 
            "Wait for delay");

        // Verify nullifier not used
        require(!nullifierHashes[nullifierHash], "Already withdrawn");
        require(address(this).balance >= amount, "Insufficient funds");

        // Verify ZK proof
        (uint256[2] memory a, uint256[2][2] memory b, uint256[2] memory c, uint256[2] memory input) = 
            abi.decode(proof, (uint256[2], uint256[2][2], uint256[2], uint256[2]));

        require(verifier.verifyProof(a, b, c, input), "Invalid proof");

        // Mark as withdrawn
        nullifierHashes[nullifierHash] = true;

        // Transfer funds
        (bool success, ) = recipient.call{value: amount}("");
        require(success, "Transfer failed");

        emit WithdrawalCompleted(recipient, amount);
    }

    // Utility functions
    function getBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function emergencyWithdraw() external onlyOwner {
        (bool success, ) = owner().call{value: address(this).balance}("");
        require(success, "Transfer failed");
    }

    receive() external payable {}
    fallback() external payable {}
}

